IF ( 
NEW.customer_id IS NULL
OR NEW.restaurant_id IS NULL
OR NEW.cost IS NULL
OR NEW.weight IS NULL
OR NEW.created_at IS NULL
OR NEW.address_id IS NULL
OR NEW.payment_id IS NULL
OR NEW.courier_id IS NULL
) THEN 
SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Current order is canceled. Check all insetred values, no one must be NULL';
END IF;
END */;;
